import './Logement.css';
import React, { useState, useEffect } from 'react';

function Logement() {

  const [logement, setLogement] = useState();

  useEffect(() => {
    fetch("http://localhost:8000/v1/users")
      .then((res) => res.json())
      .then((data) => {
        const people = data.map((tuple) => ({
          firstName: tuple[0],
          lastName: tuple[1],
          email: tuple[2],
          isVerified: tuple[3],
          avatar: tuple[4],
        }));
        setPeople(people);
      })
      .catch((error) => console.error(error));
  }, []);


  return (
    <div>
      {data ? (
        <ul>
          {data.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );

}

export default Logement;
